html = '<html xmlns="http://www.w3.org/1999/xhtml">\n<head>\n<meta name="X-Parsed-By" content="org.apache.tika.parser.DefaultParser">\n<meta name="X-Parsed-By" content="org.apache.tika.parser.microsoft.OfficeParser">\n<meta name="Content-Type" content="application/msword">\n<title></title>\n</head>\n<body><p>Antes fue empresario de eventos y ocup&oacute; altos cargos en las pr&oacute;speras empresas familiares. El joven pol&iacute;tico es el hijo mayor del magnate bananero y naviero &Aacute;lvaro Noboa Pont&oacute;n quien fue presidenciable en cinco ocasiones y en tres de ellas lleg&oacute; a segunda vuelta, una de ellas, la de 2006 la perdi&oacute; ante el entonces desconocido Rafael Correa que gobern&oacute; Ecuador por diez a&ntilde;os hasta 2017.</p><p>Tel&eacute;fono 976490844 y m&oacute;vil 659887645. Direcci&oacute;n Calle la palma numero 5, correo electr&oacute;nico olonok@hotmail.com, DNI 25152897M</p></body></html>'
html_text = "Antes fue empresario de eventos y ocupó altos cargos en las prósperas empresas familiares. El joven político es el hijo mayor del magnate bananero y naviero Álvaro Noboa Pontón quien fue presidenciable en cinco ocasiones y en tres de ellas llegó a segunda vuelta, una de ellas, la de 2006 la perdió ante el entonces desconocido Rafael Correa que gobernó Ecuador por diez años hasta 2017.\n\nTeléfono 976490844 y móvil 659887645. Dirección Calle la palma numero 5, correo electrónico olonok@hotmail.com, DNI 25152897M\n"

