html1_text = "Service Management\n\n1. Manila\n\na. SEAP\n\ni. W1 Jan/Feb/Mar\n\nii. W2 July\n\nb. SGTS\n\ni. July\n\nc. SPE (AP)\n\ni. W1 April\n\nii. W2 July\n\niii. W3 Nov\n\niv. W4 Jan\n\n2. Poland\n\na. SPE\n\ni. Live for 2 years\n\nb. SGTS\n\ni. July\n\n3. Global effort, make sure the processes work in both centers\n\nProcesses\n\n1. Query Mgmt – Service Now, separate module for queries\n\na. SEAP and Wave 1 of SPE rolled out\n\nb. Relaunch in Poland, see assignment groups, everything set up correctly\n\nc. Track issues in the same tool\n\n2. PPM Roll Out – time tracking/approval to track time spent on activities rolling out in PPM\n\n3. KPI – Key Performance Indicator (4 parameters)\n\na. Timeliness (on time?)\n\nb. Accuracy (errors?)\n\nc. Efficiency\n\nd. Business value (discount for early payment? Savings?)\n\ne. A&B part of SLA, C&D part of continuous improvement\n\nf. SLA with customer -> Service Mgmt -> Continuous Improvement\n\n4. Governance/Compliance Reporting (Reporting KPI, dashboards)\n\n5. Change Approval Process (CAB)\n\na. Done in Service Now\n\nb. Separate Module\n\n6. Business Continuity Plan (BCP) Needs to be finalized\n"
